import React, { useState } from 'react';
import './ToDolist.css';



const App = () => {
  const [addItem , getItem ] = useState([]);
  const [printItem , getPItem ] = useState([]);

  const addEvent = (pass) => {
   getItem(pass.target.value);
  }
  const PrintItemF = () => {
    getPItem((prevval) => {
      return [...prevval , addItem ]
    });
    getItem(null)

  }
return (
  <div className="main-div">
    <div className="center-div">
      <h1>ToDo list</h1>
      <input type="text" placeholder="add an item" onChange={addEvent}/>
      <button on onClick={PrintItemF}> + </button>
      {
        printItem.map((val) => {
          return <li>{val}</li>
        })
      }

    </div>
  </div>
)


}
export default App;
